import React from 'react';

function Header () {
    return (
        <div>
            <h1>Logo</h1>
            <div>
                <nav>
                    <li>Home</li>
                    <li>About</li>
                </nav>
                <button>Add Location</button>
            </div>
        </div>
    )
}

export default Header;
